O Apartamento faz uso das seguintes características:
- 1 Garagem fechada para 2 carros
- 3 suites (quartos com WC privado e completos);
- 1 WC de serviço - Hall de entrada;
- Sala com recuperador de calor;
- Cozinha completamente equipada;
- Varanda extensa com aproveitamento completo;
- Ar condicionado por conduta em todas as divisões com função de quente/frio/desumidificador;
- Roupeiros embutidos com iluminação automática;
- Sistema de domótica que permite controlar/gerir a climatização, a iluminação e estores;
- Vídeo porteiro (capta fotografia das visitas).
